sys_variable_value.value:
(function execute(inputs, outputs) {

  const items = inputs['raw_bullets']
    .split('\n')
    .map(line => line.trim())
    .filter(line => line.startsWith('-'))
    .map(line => line.replace(/^- /, '')) // Remove the dash and space
    .map(item => `  <li>${item}</li>`)
    .join('\n');

  if(!gs.nil(inputs['classification'])) {
    outputs['html_bullets'] = `<h3>` + inputs['classification'].toString() + `s</h3><ul>\n${items}\n</ul>`
  } else {
    outputs['html_bullets'] = `<ul>\n${items}\n</ul>`;
  }
 

})(inputs, outputs);

